import React from 'react';
import axios from 'axios';
export default function SignIn(){
  async function handleSignIn(){
    try{
      const res = await axios.get('http://localhost:8080/api/auth/google');
      if(res.data && res.data.url) window.location.href = res.data.url;
      else alert('Could not get auth url');
    }catch(e){
      alert('Error contacting backend: '+e.message);
    }
  }
  return (
    <div className="container">
      <h2>Sign in with Google</h2>
      <p className="small">This will open Google's consent screen and ask for calendar access.</p>
      <button className="btn" onClick={handleSignIn}>Sign in with Google (Request Calendar Access)</button>
      <div className="card small">After consent you'll be redirected back here to link a phone number to the calendar.</div>
    </div>
  );
}
